description:
Lover of Loser (2009)  

Nederland
Drama
100 minuten

geregisseerd door Dave Schram
met Gaite Jansen, Martijn Lakemeier en Ruud Feltkamp

Het zit de 15-jarige Eva (Gaite Jansen) niet mee. Met haar nieuwe stiefvader kan ze absoluut niet opschieten. Ze is bang dat hij haar wil misbruiken, maar haar moeder gelooft haar niet. Als bijverdienste ontwerpt ze T-shirts, die ze zaterdags in de printshop drukt. Op Mees (Martijn Lakemeier), de leuke jongen die daar werkt, is ze eigenlijk wel een beetje verliefd. Hij vindt haar ook erg aardig. Maar door een misverstand denkt ze dat hij al een vriendin heeft. Ze wil graag met iemand praten. Iemand die haar serieus neemt. Maar haar beste vriendin heeft daar nu geen tijd voor. Die heeft net een nieuwe vriend die haar helemaal opslokt. Als bij een optreden van een muziekband de vlotte knappe Ricardo aandacht aan haar besteedt, is ze al snel helemaal verloren. Hij pakt haar helemaal in met leuke kleren en wil haar zelfs voorstellen aan een bekende Parijse modeontwerper. Mees vindt het maar niets.


